pub enum Info<T, R, F = &'static str> {
    Token(T),
    Range(R),
    Static(&'static str),
    Format(F),
}

pub enum ParseResult<T, E> {
    CommitOk(T),
    PeekOk(T),
    CommitErr(E),
    PeekErr(Tracked<E>),
}

pub enum Info<T, R> {
    Token(T),
    Range(R),
    Owned(String),
    Static(&'static str),
}

pub enum Error<T, R> {
    Unexpected(Info<T, R>),
    Expected(Info<T, R>),
    Message(Info<T, R>),
    Other(Box<dyn StdError + Send + Sync>),
}

pub enum Error<E, P> {
    Parse(E),
    Io {
        position: P,
        error: io::Error,
    },
}

